import React, { useState } from 'react';
import { TouchableOpacity, Button, SafeAreaView, StyleSheet, Text, TextInput, View } from 'react-native';

export default function Home(props) {

    function storeClick() {
        props.navigation.navigate('Store');
    }
    function alarmsClick() {
        alert('already in alarms page');
    }
    return (
        <View style={styles.container}>
            <View style={styles.topContainer}>
                <TouchableOpacity onPress={storeClick} style={styles.button}>
                    <Text style={styles.buttonText}>Store</Text>
                </TouchableOpacity>
                <TouchableOpacity onPress={alarmsClick} style={styles.button}>
                    <Text style={styles.buttonText}>Alarms</Text>
                </TouchableOpacity>
            </View>
            <Text>Home screen</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        display: 'flex',
        flex: 1,
        flexDirection: 'column',
        marginTop: 25
    },
    topContainer: {
        flex: 1,
        alignItems: 'center',
        display: 'flex',
        flexDirection: 'row',
        height: 40,
        maxHeight: 60,
        width: '100%',
        backgroundColor: 'skyblue'
    },
    button: {
        width: 80,
        height: 40,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#E94560',
        borderRadius: 5,
        marginLeft: 30
    },
    buttonText: {
        fontSize: 15,
        color: '#e1e1e1'
    }
})
